import React from 'react';
import "./style.css";

function Contact(props) {
    return (
        <div className="popup-container">
            <button className="close-popup">
                x
            </button>
            <img 
                src={require("../../assets/popup-me.png")}
                alt="pop-up-rupert"
                className="contact-popup"
            />

            <h1>Contact me here!</h1>
        </div>
    );
}

export default Contact;
